import styles from "./HistoryOrders.module.css";

const HistoryOrders = () => {
  const listCart = [];
  return (
    <>
      <section>
        <div className="overflow-scroll">
          <table
            className={`text-center text-wrap table table-striped ${styles["tbl"]}`}
          >
            <thead>
              <tr>
                <th>ID ORDER</th>
                <th>ID USER</th>
                <th>NAME</th>
                <th>PHONE</th>
                <th>ADDRESS</th>
                <th>TOTAL</th>
                <th>DELIVERY</th>
                <th>STATUS</th>
                <th>DETAIL</th>
              </tr>
            </thead>
            <tbody>
              {listCart &&
                listCart.map((cartItem) => {
                  return (
                    <CartItem key={cartItem.product._id} cart={cartItem} />
                  );
                })}
            </tbody>
          </table>
          {/* Nếu không có listCart render NoProductInCart component */}
          {!listCart || (listCart.length === 0 && <NoProductInCart />)}
        </div>
      </section>
    </>
  );
};

export default HistoryOrders;
